import React from 'react'
import { useState } from 'react'
import AnchorLink from 'react-anchor-link-smooth-scroll'
import useMediaQuery from '../hooks/useMediaQuery'
import menuicon from '../assets/menu-icon.svg'
import closeicon from '../assets/close-icon.svg'

const Navbar = ({isTopOfPage,setselectedPage, selectedPage}) => {

    const [isMenuToggled, setisMenuToggled] = useState(false)
    const isAboveSmallScreen = useMediaQuery("(min-width: 768px)")
    const backgroundColor = isTopOfPage ? "" : "bg-red"

    const Link = ({page, selectedPage, setselectedPage}) => {
        const lowercasePage = page.toLowerCase();
        return( 
            <AnchorLink className={`${selectedPage === lowercasePage ? "text-yellow" : "text-white"}
            hover:text-yellow transition duration-500`}
            href={`#${lowercasePage}`}
            onClick={() => setselectedPage(lowercasePage)}
            >
                {page}
            </AnchorLink>
        )
    }

    return (
    <nav className={`${backgroundColor} z-40 w-full fixed top-0 py-6 `}>
        <div className='flex items-center justify-between mx-auto w-5/6'>
            <h4 className='font-playfair text-3xl font-bold'>PS</h4>
            {/* Desktop Navbar */}
            {isAboveSmallScreen ? (
                <div className='flex justify-between gap-16 font-opensans text-sm font-semibold'>
                <Link page="Home" selectedPage={selectedPage} setselectedPage={setselectedPage} />
                <Link page="About" selectedPage={selectedPage} setselectedPage={setselectedPage} />
                <Link page="Skills" selectedPage={selectedPage} setselectedPage={setselectedPage} />
                <Link page="Projects" selectedPage={selectedPage} setselectedPage={setselectedPage} />
                <Link page="Contact" selectedPage={selectedPage} setselectedPage={setselectedPage} />


                </div>
            ): (

                    <button className='rounded-full bg-red p-2' onClick={()=> setisMenuToggled(!isMenuToggled)}>
                        <img alt="menu-icon" src={menuicon}></img>
                    </button>
            )}

            {!isAboveSmallScreen && isMenuToggled && (
                <div className='fixed right-0 bottom-0 h-full bg-blue w-[300px]'>
                    <div className='flex justify-end p-12'>
                        <button onClick={() => setisMenuToggled(!isMenuToggled)}>
                            <img alt='close-icon' src={closeicon}></img>
                        </button>
                    </div>
                    <div className='flex flex-col gap-10 ml-[33%] text-2xl text-deep-blue'>
                <Link page="Home" selectedPage={selectedPage} setselectedPage={setselectedPage} />
                <Link page="About" selectedPage={selectedPage} setselectedPage={setselectedPage} />
                <Link page="Skills" selectedPage={selectedPage} setselectedPage={setselectedPage} />
                <Link page="Projects" selectedPage={selectedPage} setselectedPage={setselectedPage} />
                <Link page="Contact" selectedPage={selectedPage} setselectedPage={setselectedPage} />
                </div>

                </div>
            )}

        </div>

    </nav>
  )
}

export default Navbar

